import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import cardStuff from './cards.jsx';
import {Button, Card, Container, Col, Row, CardColumns, } from 'react-bootstrap'


function App() {
  return (
    <div className="App">
    <header className='App-header'>

  <CardColumns>

      <Button1/>
      <Cards /> <Cards />


  </CardColumns>      

    </header>



    </div> 
  );
}

function Button1() {
  return (
  <div>
  <Button>Did this work Scott???</Button>
  </div>
  );
}

function Cards() {
  return (
  <div>

   <Card className='mb-3' style={{ color: "#000" }}>
  <Row>  
      <Card.Body>
        hi
      <Card.Title>About</Card.Title>          
       </Card.Body>
  </Row>

   </Card>



   <Card className='mb-3' style={{ color: "#000" }}>

   <Card.Body>
     hi
      <Card.Title>
            About
      </Card.Title>          
      </Card.Body>



    </Card>


  </div>
  );
}
export default App;
